import React, { useState } from 'react';
import './App.css';
import MovieList from './components/MovieList';
import Filter from './components/Filter';
import AddMovie from './components/AddMovie';

function App() {
  const [movies, setMovies] = useState([
    {
      id: 1,
      title: 'Inception',
      description: 'A thief who steals corporate secrets through dream-sharing technology.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 8.8,
      year: 2010
    },
    {
      id: 2,
      title: 'The Dark Knight',
      description: 'Batman faces the Joker, a criminal mastermind who seeks to undermine society.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 9.0,
      year: 2008
    },
    {
      id: 3,
      title: 'Interstellar',
      description: 'A team of explorers travel through a wormhole in space to ensure humanity\'s survival.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 8.6,
      year: 2014
    },
    {
      id: 4,
      title: 'Parasite',
      description: 'A poor family schemes to become employed by a wealthy family by infiltrating their household.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 8.6,
      year: 2019
    },
    {
      id: 5,
      title: 'La La Land',
      description: 'A jazz pianist falls for an aspiring actress in Los Angeles.',
      posterURL: 'data:image/jpeg;base64,',
      rating: 8.0,
      year: 2016
    }
  ]);

  const [titleFilter, setTitleFilter] = useState('');
  const [ratingFilter, setRatingFilter] = useState(0);

  const handleAddMovie = (newMovie) => {
    setMovies([...movies, {
      ...newMovie,
      id: movies.length + 1,
      rating: parseFloat(newMovie.rating)
    }]);
  };

  const filteredMovies = movies.filter(movie => {
    return (
      movie.title.toLowerCase().includes(titleFilter.toLowerCase()) &&
      movie.rating >= ratingFilter
    );
  });

  return (
    <div className="App">
      <header className="app-header">
        <h1>My Favorite Movies</h1>
        <p>Add, rate, and filter your favorite movies and TV shows</p>
      </header>

      <div className="container">
        <div className="left-panel">
          <AddMovie onAddMovie={handleAddMovie} />
        </div>

        <div className="right-panel">
          <Filter
            titleFilter={titleFilter}
            ratingFilter={ratingFilter}
            onTitleChange={setTitleFilter}
            onRatingChange={setRatingFilter}
          />
          
          <div className="movies-count">
            Showing {filteredMovies.length} of {movies.length} movies
          </div>
          
          <MovieList movies={filteredMovies} />
        </div>
      </div>
    </div>
  );
}

export default App;